'use client'
import { type FC } from 'react'
import Link from 'next/link'
import capitalize from '@Helpers/capitalize'

interface Props{
    body:string,
    title:string,
    category:string,
    id:any
}
const game = "data:image/jpeg;base64,"
const mobile = "data:image/jpeg;base64,"
const front = "data:image/png;base64,"
const backend = "data:image/jpeg;base64,"
const AI = "data:image/jpeg;base64,"
const DataScience = "data:image/jpeg;base64,"
const others = "data:image/jpeg;base64,"
const randomImage = (category:string) => {
    switch (category) {
        case 'Game': return game;
        case "Mobile": return mobile;
        case "AI": return AI;
        case "Data Science": return DataScience;
        case "Front-end": return front;
        case "Back-end": return backend;
        default: return others
    }
}
const Course:FC<Props> = ({body,title,category,id}) => {
    const image = randomImage(category)
    return (
        <div className='p-3 sm:w-1/2 lg:w-1/3 '>
            <div className="w-full flex flex-col cursor-pointer rounded-lg sm:hover:scale-105 duration-300 border p-2">
                <div>
                    <img className="w-full h-[200px]" src={image} alt={`${category} course image`}/>
                </div>
                <div className='mt-3'>
                    <h3 className='text-xl font-bold'>{capitalize(title)}</h3>
                </div>
                <div className='text-lg mt-3'>
                    <h4>category: {category}</h4>
                </div>
                <div className='my-3'>
                    <p className='line-clamp-3' title={body}>{body}</p>
                </div>
                <div className='border-t pt-3 '>
                    <Link className='text-blue-500 duration-300 hover:text-blue-700  font-bold' href={`/products/${id}`}>See Product →</Link>
                </div>
            </div>
        </div>
    )
}

export default Course